import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';

class Education extends Component {
  render() {
    return (
      <Grid>
        <Cell col={4}>Left</Cell>
        <Cell col={8}>Right</Cell>
      </Grid>
    );
  }
}

export default Education;
